import React, {useState, useEffect} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import LoginPage from './LoginPage';
import ClassSearchPage from './ClassSearchPage';
import GenerateSchedulesPage from './GenerateSchedulesPage';
import SavedSchedulesPage from './SavedSchedulesPage';
import AuthContext from "../contexts/AuthContext";

function App() {
  const [firebaseInitialized, setFirebaseInitialized] = useState(false)

  useEffect(() => {
    AuthContext.isInitialized().then(val=> {
      setFirebaseInitialized(val)
    })
  })

  return (
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to='/'>Login</Link>
              </li>
              <li>
                <Link to="/search">Class Search</Link>
              </li>
              <li>
                <Link to="/generate">Generate</Link>
              </li>
              <li>
                <Link to="/saved">Saved Schedules</Link>
              </li>
            </ul>
          </nav>
          <Switch>
            <Route path="/search">
              <ClassSearchPage />
            </Route>
            <Route path="/generate">
              <GenerateSchedulesPage />
            </Route>
            <Route path="/saved">
              <SavedSchedulesPage />
            </Route>
            <Route path="/">
              <LoginPage />
            </Route>
          </Switch>
        </div>
      </Router>

  );
}

export default App;
